import React from "react";
import Header from '../../components/header/header.js';
import {base_url} from "../../constants.js";
import Stripe from "../../stripe.js"
import data from '../../data.json';
import axios from "axios";
import './calendar.css';

class Calendar extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            id: '',
            data_list: [],
            dates: []
        }
    }

    loadInfo() {
        if (this.state.id == '') {
            return
        }
        let url = base_url + '/calendar/' + this.state.id + '?count=7';
        axios.get(url, {
            withCredentials: true
        }).then(res => {
            let data = res.data;
            this.setState({
                data_list: data.events,
                dates: data.dates
            })
            console.log(data.dates)
        }).catch(error => {
            console.log(error);
            this.setState({
                is_error: true,
                error_name: error.response.status,
            });
            if (error.response.status === 404) {
                this.setState({
                    error_text: 'Пользователь не найден',
                });
            } else {
                this.setState({
                    error_text: 'Произошла ошибка. Попробуйте позже',
                });
            }
        });
    }

    componentDidUpdate(prevProps, prevState, snapshot) {
        if (prevState.id !== this.state.id) {
            document.title = this.state.id;
            this.loadInfo();
        }
    }

    componentDidMount() {
        let path = window.location.pathname;
        for (let i = path.length - 1; i > -1; --i) {
            if (path[i] === '/') {
                this.setState({id: path.slice(i + 1, path.length)});
                break;
            }
        }
    }

    getDayAndMonth(idx) {
        let month_to_name = {
            '01': 'Января',
            '02': 'Февраля',
            '03': 'Марта',
            '04': 'Апреля',
            '05': 'Мая',
            '06': 'Июня',
            '07': 'Июля',
            '08': 'Августа',
            '09': 'Сентября',
            '10': 'Октября',
            '11': 'Ноября',
            '12': 'Декабря',
        }
        if (this.state.dates.length <= idx) {
            return (
                <div className='calendar-data-panel'>
                    <h6>...</h6>
                    <span>...</span>
                </div>
            )
        }
        let year_month_day = this.state.dates[idx].split('-')
        return (
            <div className='calendar-data-panel'>
                <h6>{year_month_day[2]}</h6>
                <span>{month_to_name[year_month_day[1]]}</span>
            </div>
        )
    }

    render() {
        return (
            <>
                <Header />
                    <div className='calendar'>
                        <div className='calendar-data' style={{ zIndex: '900' }}>
                            {this.getDayAndMonth(0)}
                            <div className='calendar-data-space'>
                                <Stripe data={data} is_horizontal={false} date={'2024-04-23'} />
                            </div>
                        </div>

                        <div className='calendar-data' style={{ zIndex: '800' }}>
                            <div className='calendar-data-panel'>
                                <h6>24</h6>
                                <span>Апреля</span>
                            </div>
                            <div className='calendar-data-space'>
                                <Stripe data={data} is_horizontal={false} date={'2024-04-24'} />
                            </div>
                        </div>

                        <div className='calendar-data' style={{ zIndex: '700' }}>
                            <div className='calendar-data-panel'>
                                <h6>25</h6>
                                <span>Апреля</span>
                            </div>
                            <div className='calendar-data-space'>
                                <Stripe data={data} is_horizontal={false} date={'2024-04-25'} />
                            </div>
                        </div>

                        <div className='calendar-data' style={{ zIndex: '600' }}>
                            <div className='calendar-data-panel'>
                                <h6>26</h6>
                                <span>Апреля</span>
                            </div>
                            <div className='calendar-data-space'>
                                <Stripe data={data} is_horizontal={false} date={'2024-04-26'} />
                            </div>
                        </div>

                        <div className='calendar-data' style={{ zIndex: '500' }}>
                            <div className='calendar-data-panel'>
                                <h6>27</h6>
                                <span>Апреля</span>
                            </div>
                            <div className='calendar-data-space'>
                                <Stripe data={data} is_horizontal={false} date={'2024-04-27'} />
                            </div>
                        </div>

                        <div className='calendar-data' style={{ zIndex: '400' }}>
                            <div className='calendar-data-panel'>
                                <h6>28</h6>
                                <span>Апреля</span>
                            </div>
                            <div className='calendar-data-space'>
                                <Stripe data={data} is_horizontal={false} date={'2024-04-28'} />
                            </div>
                        </div>

                        <div className='calendar-data' style={{ zIndex: '300' }}>
                            <div className='calendar-data-panel'>
                                <h6>29</h6>
                                <span>Апреля</span>
                            </div>
                            <div className='calendar-data-space'>
                                <Stripe data={data} is_horizontal={false} date={'2024-04-29'} />
                            </div>
                        </div>
                    </div>
            </>
        );
    }
}

export default Calendar;
